import { createSlice } from '@reduxjs/toolkit';
    const initialState = {
        Profilepic:"data:image/jpeg;base64,",
     about:"I am Muhammad Basil Irfan Rizvi, a motivated and ambitious software engineering student at Bahria University. Currently pursuing a Bachelor’s degree in Software Engineering, I am passionate about technology and constantly expanding my skill set. My expertise includes HTML, CSS, Bootstrap, Tailwind CSS, JavaScript, ReactJS, NodeJS, Asp.net, C#, Java, MongoDB, and SQL. I aim to use my expertise to contribute effectively in a professional setting.",
    };
    
    const aboutSlice = createSlice({
      name: 'about',
      initialState,
      reducers: {
           setProfilepic:(state,action)=>{
            state.Profilepic= action.payload;
        },
           setAbout:(state,action)=>{
            state.about= action.payload;
        },
      },
    });
    
    export const {setImage,setDescription} = aboutSlice.actions;
    export default aboutSlice.reducer;
    